1 接口
这里使用一个比较函数接口，来演示如何使用接口。
代码路径：
JavaLearning：com.prd.interfaces.comparable.ComparableTest


接口中的方法自动属于Public，可以不提供public关键字。
在接口中可以定义常量，但不嫩有实例域。
Java8中，接口可增加静态方法。但是一般不如此使用，一般都是将静态方法放在伴随类中。如在标准库中，可以看到成对出现的工具类，Collection/Collections、Path/Paths

1.1 默认方法
可以为接口方法提供一个默认实现，使用default修饰。
默认方法的一个重要作用就是“接口演化”，即可以理解为接口的版本升级。如1.0版本时，接口A中只有 methodA，但是在1.1中接口A增加methodB，如果不定义默认方法，在使用1.0版本的代码就必须进行修改（增加methodB的实现）。
代码示例：
JavaLearning:com.prd.interfaces.defaultmethod.DefaultTest


默认方法冲突
接口中定义默认方法，在超类或另一个接口中定义了同样的方法时，会产生冲突，有以下两种处理方式。

超类优先：如果超类提供了一个具体方法，同名而且有相同参数类型的默认方法会被忽略
接口冲突：如果一个超接口提供了一个默认方法，另一个接口也提供了同名且同参的方法，则必须指定明确



代码示例：
JavaLearning:com.prd.interfaces.samemethod.SameMethondTest

1.2 标记接口
刚才示例的Comparable接口属于一般的接口，用途是确保一个类实现一个或一组特定的方法。而标记接口不包含任何方法，它的唯一作用就是允许在类型查询中使用instanceof。
如Cloneable接口，就是标记接口之一。下面借此，正好简述下对象克隆的知识点。
1.2.1 何为克隆
克隆即完全拷贝对象，包括对象在内存中保存为2份，这就是克隆。下图所示只是引用的复制，而内存中不是两份，则不是克隆。

对于基本数据类型时，如果要克隆一个变量，即复制一个变量，可以直接操作。
int num =20;
int num2 = num;

此时，num2就是num的复制。其它七种原始数据类型(boolean,char,byte,short,float,double.long)同样适用于该类情况。
对于复杂类型，想要克隆就比较复杂了。
1.2.2 为何要克隆
​        为什么需要克隆对象？直接new一个对象不行吗？
​        答案是：克隆的对象可能包含一些已经修改过的属性，而new出来的对象的属性都还是初始化时候的值，所以当需要一个新的对象来保存当前对象的“状态”就靠clone方法了。那么我把这个对象的临时属性一个一个的赋值给我新new的对象不也行嘛？可以是可以，但是一来麻烦不说，二来，大家通过上面的源码都发现了clone是一个native方法，就是快啊，在底层实现的。
　　注意，常见的Object a=new Object();Object b;b=a;这种形式的代码复制的是引用，即对象在内存中的地址，a和b对象仍然指向了同一个对象。而通过clone方法赋值的对象跟原来的对象时同时独立存在的。
1.2.3 如何实现克隆
这里先介绍2种克隆方法：浅克隆(ShallowClone)和深克隆(DeepClone)。在Java语言中，数据类型分为值类型（基本数据类型）和引用类型，值类型包括int、double、byte、boolean、char等简单数据类型，引用类型包括类、接口、数组等复杂类型。浅克隆和深克隆的主要区别在于是否支持引用类型的成员变量的复制。下图能好的说明这个：

浅克隆：

被复制的类需要实现Clonenable接口（不实现的话在调用clone方法会抛出CloneNotSupportedException异常)， 该接口为标记接口(不含任何方法)

覆盖clone()方法，访问修饰符设为public。方法中调用super.clone()方法得到需要的复制对象。（native为本地方法)


代码示例：
JavaLearning:com.prd.interfaces.cloneable.ShallowCloneTest

深克隆：

被复制的类需要实现Clonenable接口（不实现的话在调用clone方法会抛出CloneNotSupportedException异常)， 该接口为标记接口(不含任何方法)
克隆类的引用对象都覆盖clone()方法，并实现Clonenable接口。（相当于递归克隆类，出基本数据类型，其他的任何子引用对象都实现clone()）
覆盖clone()方法，访问修饰符设为public。方法中调用super.clone()方法得到需要的复制对象**。（native为本地方法)。并在clone()方法中设引用对象为原引用对象的克隆。

代码示例：
JavaLearning:com.prd.interfaces.cloneable.DeepCloneTest

1.2.4 解决多层克隆问题
如果引用类型里面还包含很多引用类型，或者内层引用类型的类里面又包含引用类型，使用clone方法就会很麻烦。这时我们可以用序列化的方式来实现对象的深克隆。
代码示例：
public class Outer implements Serializable{
  private static final long serialVersionUID = 369285298572941L;  //最好是显式声明ID
  public Inner inner;
　//Discription:[深度复制方法,需要对象及对象所有的对象属性都实现序列化]
  public Outer myclone() {
      Outer outer = null;
      try { // 将该对象序列化成流,因为写在流里的是对象的一个拷贝，而原对象仍然存在于JVM里面。所以利用这个特性可以实现对象的深拷贝
          ByteArrayOutputStream baos = new ByteArrayOutputStream();
          ObjectOutputStream oos = new ObjectOutputStream(baos);
          oos.writeObject(this);
　　　　　　// 将流序列化成对象
          ByteArrayInputStream bais = new ByteArrayInputStream(baos.toByteArray());
          ObjectInputStream ois = new ObjectInputStream(bais);
          outer = (Outer) ois.readObject();
      } catch (IOException e) {
          e.printStackTrace();
      } catch (ClassNotFoundException e) {
          e.printStackTrace();
      }
      return outer;
  }
}

Inner也必须实现Serializable，否则无法序列化：
public class Inner implements Serializable{
  private static final long serialVersionUID = 872390113109L; //最好是显式声明ID
  public String name = "";

  public Inner(String name) {
      this.name = name;
  }

  @Override
  public String toString() {
      return "Inner的name值为：" + name;
  }
}

1.2.5 标记接口
在1.2.1~1.2.4中的覆盖clone()时，必须实现Cloneable接口，否则在运行clone()方法时会提示CloneNotSupportedException异常。
2 lambda表达式
​        lambda表达式是一个可传递的代码块，可以执行一次或多次。其主要的思想就是在Java中传递一个代码段。
​        lambda的语法：参数，箭头(->)以及一个表达式。如果代码无法在一个表达式中写完，则把这些代码放在{}中。
​        lambda表达式没有参数时，要提供() 号。
​        如果可以推导出一个lambda表达式的参数类型，则可以忽略其类型。
(String first,String second) -> first.length()-second.length();

2.1 函数式接口
​        有且仅有一个抽象方法，但是可以有多个非抽象方法的接口称之为函数接口。函数式接口可以被隐式转换为 lambda 表达式和方法引用（实际上也可认为是Lambda表达式）上。只有在需要传递这些函数接口时，可以用lambda表达式代替。
​        如定义了一个函数式接口如下：
@FunctionalInterface
interface GreetingService 
{
    void sayMessage(String message);
}
​        @FunctionalInterface 注解的作用只是告诉编译器检查这个接口，保证该接口只能包含一个抽象方法，否则就会编译出错。
​        Java8 API中新增了许多函数式接口:



