Predicate概述

​       有时候我们需要对某种类型的数据进行判断，从而得到一个boolean值结果。这时可以使用java.util.function.Predicate 接口。
@FunctionalInterface
public interface Predicate {
    boolean test(T t);
    ......
}

​        Predicate还实现有多个default方法，可以进行 &（与），|（或），！（非）等组合判断。
代码示例：
JavaLearning:com.prd.interfaces.functional.PredicateTest

UnaryOperator接口概述public interface UnaryOperator extends Function

​        从extends Function可以看出, 这个方法是Function的一个简单写法, 即传入一个参数, 返回值类型和参数类型相同的方法。这个方法当然也继承了andThen和compose; 此外, 由于静态方法不能继承所以在代码中重写了一遍, 其作用是相同的。

代码示例：
JavaLearning:com.prd.interfaces.functional.UnaryOperatorTest

类似的接口

IntFunction等, 传入参数为int等基本类型, 返回类型为R。
ToIntFunction 等, 传入类型为T, 返回类型为int。
IntToDoubleFunction等, 传入int, 返回double。
BiFunction, 传入类型为T和u, 返回类型为R。
ToIntBiFunction, 传入类型为T和U, 返回类型为int。
 需要注意, 上面的方法和Funciton本身并没有继承关系, 都是相互独立的。

2.2 lambda表达式语法

lambda表达式的一般语法

(Type1 param1, Type2 param2, ..., TypeN paramN) -> {
  statment1;
  statment2;
  //.............
  return statmentM;
}

这是lambda表达式的完全式语法，后面几种语法是对它的简化。

单参数语法

param1 -> {
  statment1;
  statment2;
  //.............
  return statmentM;
}

当lambda表达式的参数个数只有一个，可以省略小括号
例如：
将列表中的字符串转换为全小写
List proNames = Arrays.asList(new String[]{"Ni","Hao","Lambda"});
List lowercaseNames1 = proNames.stream().map(name -> {return name.toLowerCase();}).collect(Collectors.toList());


单语句写法

param1 -> statment

当lambda表达式只包含一条语句时，可以省略大括号、return和语句结尾的分号
例如：将列表中的字符串转换为全小写
List proNames = Arrays.asList(new String[]{"Ni","Hao","Lambda"});
List lowercaseNames2 = proNames.stream().map(name -> name.toLowerCase()).collect(Collectors.toList());


方法引用写法

（方法引用和lambda一样是Java8新语言特性，后面会讲到）
Class or instance :: method

例如：将列表中的字符串转换为全小写
List proNames = Arrays.asList(new String[]{"Ni","Hao","Lambda"});
List lowercaseNames3 = proNames.stream().map(String::toLowerCase).collect(Collectors.toList());

2.3 lambda表达式可使用的变量
先举例：
//将为列表中的字符串添加前缀字符串
String waibu = "lambda :";
List proStrs = Arrays.asList(new String[]{"Ni","Hao","Lambda"});
ListexecStrs = proStrs.stream().map(chuandi -> {
Long zidingyi = System.currentTimeMillis();
return waibu + chuandi + " -----:" + zidingyi;
}).collect(Collectors.toList());
execStrs.forEach(System.out::println);

输出:
lambda :Ni -----:1474622341604
lambda :Hao -----:1474622341604
lambda :Lambda -----:1474622341604
变量waibu ：外部变量
变量chuandi ：传递变量
变量zidingyi ：内部自定义变量
​        lambda表达式可以访问给它传递的变量，访问自己内部定义的变量，同时也能访问它外部的变量。
​        不过lambda表达式访问外部变量有一个非常重要的限制：变量不可变（只是引用不可变，而不是真正的不可变）。
​        当在表达式内部修改waibu = waibu + " ";时，IDE就会提示你：Local variable waibu defined in an enclosing scope must be final or effectively final编译时会报错。因为变量waibu被lambda表达式引用，所以编译器会隐式的把其当成final来处理。以前Java的匿名内部类在访问外部变量的时候，外部变量必须用final修饰。现在java8对这个限制做了优化，可以不用显示使用final修饰，但是编译器隐式当成final来处理。
2.4 方法引用
​        方法引用就是在不调用方法的情况下引用方法，即就是简化lambda语法。如：Timer r = new Timer(1000, event - > System.out.println(event)) 就可以简化为 Timer r = new Timer(1000, System.out::println)。
​        方法引用的标准形式是:类名::方法名。（注意：只需要写方法名，不需要写括号）



类型
示例




引用静态方法
Class::staticMethod


引用某个对象的实例方法
object::instanceMethod


引用某个类型的任意对象的实例方法
ClassType::instanceMethod


引用构造方法
ClassName::new



2.4.1 出现方法引用的原因
​        在Java中，我们可以通过创建新对象来使用对象的引用,或者引用已有的对象，例如：
//创建新对象来引用该对象
List list = new ArrayList();
dosth(list);

//引用已有的对象
List list2 = list;
dosth(list2);

​        如果我们只在另一个方法中使用对象的方法，我们仍然必须将完整的对象作为参数传递。那么将方法作为参数传递不是更有效吗？方法引用这种语法糖不能用于所有的方法，它们只能用于只有一个方法的lambda表达式。
//lambda转方法引用
Consumer c = s -> System.out.println(s);
Consumer c = System.out::println;

2.4.2 静态方法引用
​        当我们所使用的lambda表达式仅仅调用了一个静态方法，我们就可以使用静态方法引用。格式如：(args) -> Class.staticMethod(args) ==> Class::staticMethod，不需要显式的传递参数，方法引用中会自动传递参数。
代码示例:
JavaLearning:com.prd.interfaces.reference.ClassMethodReferenceTest

2.4.3 特定类型的对象的实例方法的方法引用
​        使用实例的类型而非实例本身，参数隐式传递。格式如：(obj, args) -> obj.instanceMethod(args)==>ObjectType::instanceMethod
代码示例：
JavaLearning:com.prd.interfaces.reference.ClassInstanceMethodReferenceTest

2.4.4 已有对象的实例方法引用
​        直接引用已经在其他地方实例化的对象的一个方法，本身不需要再实现一次。格式如：(args) -> obj.instanceMethod(args)==>obj::instanceMethod
代码示例：
JavaLearning:com.prd.interfaces.reference.ObjectInstranceMethodReferenceTest

2.4.5 构造方法引用
​        唯一的功能就是创建一个新对象，与其他情况一样，参数（如果有）不会在方法引用中传递。格式如：(args) -> new ClassName(args)==>ClassName::new。
​        如果存在多个构造函数，则Java会根据实际情况，推算使用哪个构造器。
​        Java是无法创建泛型类型T的数组，但是通过构造方法引用，可以轻易的实现这个。eg：Person[] people = stream.toArray(Person[]::new)。
代码示例：
JavaLearning:com.prd.interfaces.reference.ConstructorReferenceTest

2.4.6 总结
​        方法引用常用户Java8的Streams特性中，使得编码更为简练，同时可以使设计模式更为精巧。

javase/002-innerClass.html.body:
内部类：即定义在另一个类中的类。使用内部类的主要原因：


内部类方法可以访问该类定义所在的作用域中的数据，包括私有的数据。
内部类可以对同一个包中的其他类隐藏起来。
当要定义一个回调函数时，可以使用匿名内部类。

1 基础

内部类既可以访问自身的数据域，也可以访问创建它的外部类对象的数据域。
内部类的对象中有一个隐式引用，指向创建它的外部类对象。语法：OutClass.this

代码示例：
JavaLearning：com.prd.innerclass.InnerClassBaseTest

2 成员内部类
​        定义在另外一个类中，是最为普通的内部类。构造语法如下：OutClass.InnerClass innerobject = outobject.new InnerClass(construction parameters)。
​        在外部类范围之外，访问内部类的语法：OuterClass.InnerClass。
​        内部类可以拥有访问权限：

private：只能在外部类的内部访问。
protected：只能在同一个包下或者外部类的子类中访问。
包（默认）：只能在同一个包下访问。
public：任何地方都能访问。

3 局部内部类
​        定义在一个方法或者作用域之内的类。与成员内部类的不同，局部内部类的访问仅限于方法内或作用域内。

在局部内部类前不能用修饰符public和private,protected，static. 
可以定义与外部类同名的变量
如果内部类没有与外部类同名的变量，在内部类中可以直接访问外部类的实例变量
如果内部类中有与外部类同名的变量，直接用变量名访问的是内部类的变量，用this.变量名访问的也是内部类变量。用外部类名.this.内部类变量名访问的是外部类变量。
不可以定义静态变量和静态方法
可以访问外部类的局部变量(即方法内的变量)，但是变量必须是final的     
可以访问外部类的所有成员

代码示例：
public class InnerClassA {
    private String str1 = "abc";
    private int n = 35;
    private static String str2 = "MMM";
    public void show(){
        final int K = 54;
        class InnerOne{
            int n = 12;
            //static String s = "name";内部类中不能定义static变量.
            public void aaa(){
                System.out.println("局部常量K的值为:  "+K);
                System.out.println("外围类成员变量str1的值:  "+str1);
                System.out.println("外围类成员变量n的值:  "+InnerClassA.this.n);
                System.out.println("外围类成员变量str2的值:  "+str2);
                System.out.println("内部类成员变量n的值:  "+n);
            }
        }
        new InnerOne().aaa();
    }
    public static void main(String[] args) {
        InnerClassA a = new InnerClassA();
        a.show();
    }
}

4 匿名内部类
​        匿名内部类，可以认为是一个特殊的局部内部类。它是一个唯一没有构造器的内部类，大多数情况下，用于接口回调。匿名内部类在编译的时候由系统自动起名为Outter$1.class。
​        匿名内部类用于继承其他类或是实现接口，并不需要增加额外的方法，只是对继承方法的实现或是重写。

匿名内部类不能有构造方法。  
匿名内部类不能定义任何静态成员、方法和类。  
匿名内部类不能是public,protected,private,static。  
只能创建匿名内部类的一个实例。
一个匿名内部类一定是在new的后面，用其隐含实现一个接口或实现一个类。  
因匿名内部类为局部内部类，所以局部内部类的所有限制都对其生效。
匿名内部类不能是抽象的，它必须要实现继承的类或者实现的接口的所有抽象方法。
当所在的方法的形参需要被内部类里面使用时，该形参必须为final
匿名内部类只要实现接口或抽象类的方法即可，及时另外定义方法，在new后也无法访问。但是通过反射可以。

示例1：匿名内部类的基本实现
abstract class Person {
    public abstract void eat();
}
public class Demo {
    public static void main(String[] args) {
        Person p = new Person() {
            public void eat() {
                System.out.println("eat something");
            }
        };
        p.eat();
    }
}

示例2：在接口上使用匿名内部类
interface Person {
    public void eat();
}

public class Demo {
    public static void main(String[] args) {
        Person p = new Person() {
            public void eat() {
                System.out.println("eat something");
            }
        };
        p.eat();
    }
}

