​        要搞明白 fail-fast机制，我们就要需要理解什么时候“modCount 不等于 expectedModCount”！。   
​        从Itr类中，我们知道 expectedModCount 在创建Itr对象时，被赋值为 modCount。通过Itr，我们知道：expectedModCount不可能被修改为不等于 modCount。所以，需要考证的就是modCount何时会被修改。  
