1 概述

是一个有序的集合，它的作用是提供有序的Set集合。它继承于AbstractSet抽象类，实现了NavigableSet, Cloneable, java.io.Serializable接口。
继承于AbstractSet，所以它是一个Set集合，具有Set的属性和方法。
