​        TreeSet是基于TreeMap实现的。TreeSet中的元素支持2种排序方式：自然排序 或者 根据创建TreeSet 时提供的 Comparator 进行排序。这取决于使用的构造方法。
​        TreeSet为基本操作（add、remove 和 contains）提供受保证的 log(n) 时间开销。
​        另外，TreeSet是非同步的。 它的iterator 方法返回的迭代器是fail-fast的。
