​        PriorityQueue 和 ConcurrentLinkedQueue 类在 Collection Framework中加入两个具体集合实现。 
4.1.1 PriorityQueue
​        PriorityQueue 类实质上维护了一个有序列表。加入到 Queue 中的元素根据它们的天然排序（通过其 java.util.Comparable 实现）或者根据传递给构造函数的 java.util.Comparator 实现来定位。
​        在任何时候调用remove()，总会删除并获得当前优先级队列中的最小元素。可以理解 PriorityQueue对于队列的意义来说，和TreeSet对于列表的意义一样。是在普通队列外，提供一个可以排序的队列。
​        优先级队列使用了一个优雅且高效的数据结构，称为堆（heap)，小顶堆。堆是一个可以自我调整的二叉树，对树执行添加 （add) 和删除（remore) 操作， 可以让最小的元素移动到根，而不必花费时间对元素进行排序。
​        与 TreeSet—样，一个优先级队列既可以保存实现了 Comparable 接口的类对象， 也可以保存在构造器中提供的 Comparator 对象。   
4.1.1.1 源码解析
