        table = newTab;
        if (oldTab != null) {
            for (int j = 0; j  e;
                if ((e = oldTab[j]) != null) {
                    oldTab[j] = null;
                    // 单节点，直接计算下标保存
                    if (e.next == null)
                        newTab[e.hash & (newCap - 1)] = e;
                    // 红黑树模式
                    else if (e instanceof TreeNode)
                        ((TreeNode)e).split(this, newTab, j, oldCap);
                    // 链表保存的节点
                    // 根据hash值与旧hash表的大小2^n做与运算，将数据一分为二
                    else { 
                        Node loHead = null, loTail = null;
                        Node hiHead = null, hiTail = null;
                        Node next;
                        do {
                            next = e.next;
                            // e.hash/oldCap 商为0或偶数
                            if ((e.hash & oldCap) == 0) {
                                if (loTail == null)
                                    loHead = e;
                                else
                                    loTail.next = e;
                                loTail = e;
                            }
                            // e.hash/oldCap 商为奇数
                            else {
                                if (hiTail == null)
                                    hiHead = e;
                                else
                                    hiTail.next = e;
                                hiTail = e;
                            }
                        } while ((e = next) != null);
                        // 为偶数时写入 原下标位置，且最后一个节点的下一个节点做空
                        if (loTail != null) {
                            loTail.next = null;
                            newTab[j] = loHead;
                        }
                        // 为奇数时写入 原（下标+原数组大小）位置，且最后一个节点的下一个节点做空
                        if (hiTail != null) {
