5.3 getNode
// 根据key查找对应的数据节点
final Node getNode(int hash, Object key) {
        Node[] tab; Node first, e; int n; K k;
        if ((tab = table) != null && (n = tab.length) > 0 &&
            // 定位hash表下标
            (first = tab[(n - 1) & hash]) != null) {
            //  第一个元素
            if (first.hash == hash && // always check first node
                ((k = first.key) == key || (key != null && key.equals(k))))
                return first;
            if ((e = first.next) != null) {
                // 红黑树模式
                if (first instanceof TreeNode)
                    return ((TreeNode)first).getTreeNode(hash, key);
                // 链表模式，比对每项的key值
                do {
                    if (e.hash == hash &&
                        ((k = e.key) == key || (key != null && key.equals(k))))
                        return e;
                } while ((e = e.next) != null);
            }
        }
        return null;
    }

5.4 removeNode
    final Node removeNode(int hash, Object key, Object value,
                               boolean matchValue, boolean movable) {
        Node[] tab; Node p; int n, index;
        // 根据key值查找待删除的节点node，p为first节点或待删除节点的上个节点。
        if ((tab = table) != null && (n = tab.length) > 0 &&
            (p = tab[index = (n - 1) & hash]) != null) {
            Node node = null, e; K k; V v;
            if (p.hash == hash &&
                ((k = p.key) == key || (key != null && key.equals(k))))
                node = p;
            else if ((e = p.next) != null) {
                if (p instanceof TreeNode)
                    node = ((TreeNode)p).getTreeNode(hash, key);
                else {
                    do {
                        if (e.hash == hash &&
                            ((k = e.key) == key ||
                             (key != null && key.equals(k)))) {
                            node = e;
                            break;
                        }
                        p = e; // 待删除节点的上个节点
                    } while ((e = e.next) != null);
                }
            }
            // matchValue为true时需要同时比较value是否euqals
            if (node != null && (!matchValue || (v = node.value) == value ||
                                 (value != null && value.equals(v)))) {
                if (node instanceof TreeNode)  // node为红黑树模式
                    ((TreeNode)node).removeTreeNode(this, tab, movable);
                else if (node == p)  //  node为链表的头节点
                    tab[index] = node.next;
                else     //  p为待删除节点的上级，node为待删除节点
                    p.next = node.next;
                ++modCount;
                --size;
                // 该方法为空，在HashMap的子类LinkedHashMap中有实现，是指删除节点后的操作
                afterNodeRemoval(node);
                return node;
            }
        }
        return null;
    }

